import React from 'react';
import '../../sass/Tela1/tela1.css'

const Tela4 = () => {
    
    const [tela1, setTela1] = React.useState(false);
    const [tela2, setTela2] = React.useState(false);

    const botaoOpt1 = () => {
        tela1 ? setTela1(tela1) : setTela1(!tela1);
        !tela2 ? setTela2(tela2) : setTela2(!tela2);
    }
    const botaoOpt2 = () => {
        tela1 ? setTela1(tela1) : setTela1(!tela1);
        !tela2 ? setTela2(tela2) : setTela2(!tela2);
    }

    return(
        <>
        <div className='tela--inicial--tela1'>
            <p className='item' onClick={botaoOpt1} >Comunicação de Processo</p>
            <p className='item' onClick={botaoOpt2} >Cancelamento de Processo</p>
        </div>
        </>
    )
}

export default Tela4
